//go:build cgo && ((linux && amd64) || (darwin && amd64) || (darwin && arm64) || (windows && amd64)) && sphincs_shake_256f

package tests

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
  sphincsplus "github.com/katzenpost/sphincsplus/ref"
)

func TestSignVerifyVectorSpecifics(t *testing.T) {

	privKey := new(sphincsplus.PrivateKey)
	privKeyBytes, err := hex.DecodeString("60547d8ab249889b797d6cea5917cb3d49d534dc676b1b083636ffc9787bffca076156348344f1af250591bfe490aee5b0391371e69eac5dc7d44e4f73d3bd9954c5fd001f3dbf0a018a77236f84f80e3f50a9ab150edbd30f265f1e1dbd1340b2c69334d3542b5a1ffba4e66a329a93a29fd5ddb7381c85fd974f245ecd99b3")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(sphincsplus.PublicKey)
	pubKeyBytes, err := hex.DecodeString("54c5fd001f3dbf0a018a77236f84f80e3f50a9ab150edbd30f265f1e1dbd1340b2c69334d3542b5a1ffba4e66a329a93a29fd5ddb7381c85fd974f245ecd99b3")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

	signature, err := hex.DecodeString("")
	require.NoError(t, err)

	t.Logf("SPHINCS+ scheme parameters: %s", sphincsplus.SchemeName())
	t.Logf("priv key %x", privKey.Bytes())
	t.Logf("pub key %x", pubKey.Bytes())
	t.Logf("sig %x", signature)
	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
